import React from "react";
import TextField from "@material-ui/core/TextField";
import Autocomplete from "@material-ui/lab/Autocomplete";

const SearchBox = () => {
  return (
    <Autocomplete
      id="free-solo-demo"
      freeSolo
      options={searchedUsers.map((option) => option.display_name)}
      renderInput={(params) => (
        <TextField
          {...params}
          label="freeSolo"
          margin="normal"
          variant="outlined"
        />
      )}
    />
  );
};

const searchedUsers = [
  { display_name: "test1" },
  { display_name: "test2" },
  { display_name: "test3" },
];

export default SearchBox;
